<body>
    <div class="container">
        <!-- Main Content - Full Height -->
        <main class="main-content">
            <!-- Featured Event Slide -->
            <section class="slide-view" id="slideView">
                <!-- Corner Logo -->
                <div class="slide-corner-logo">
